/**
* WorldMap image data.
*/
var IMGMAP;
// images urls
function imgMapByUrl() { 
IMGMAP = {
'wrld_small': 'demodata/img/wrld-small.jpg',
'wrld_small_merc': 'demodata/img/wrld-small-merc.jpg',
'wrld_small_mill': 'demodata/img/wrld-small-mill.jpg',
'wrld_small_moll': 'demodata/img/wrld-small-moll.jpg' }
}
// base64 encoded images
function imgMapB64() {
IMGMAP = {
'wrld_small': 'data:image/jpg;base64,',
'wrld_small_merc': 'data:image/jpg;base64,',
'wrld_small_mill': 'data:image/jpg;base64,',
'wrld_small_moll': 'data:image/jpg;base64,' }
}
if (/WebKit/.test(navigator.userAgent)) { // base64 encoded if WebKit
  imgMapB64();
} else { // urls
  imgMapByUrl();
}